function createBasePaymentsListData(): PaymentsListData {
  return { paymentMethods: [] };
}

export const PaymentsListData: MessageFns<PaymentsListData> = {
  encode(message: PaymentsListData, writer: BinaryWriter = new BinaryWriter()): BinaryWriter {
    for (const v of message.paymentMethods) {
      PaymentMethod.encode(v!, writer.uint32(10).fork()).join();
    }
    return writer;
  },

  decode(input: BinaryReader | Uint8Array, length?: number): PaymentsListData {
    const reader = input instanceof BinaryReader ? input : new BinaryReader(input);
    const end = length === undefined ? reader.len : reader.pos + length;
    const message = createBasePaymentsListData();
    while (reader.pos < end) {
      const tag = reader.uint32();
      switch (tag >>> 3) {
        case 1: {
          if (tag !== 10) {
            break;
          }

          message.paymentMethods.push(PaymentMethod.decode(reader, reader.uint32()));
          continue;
        }
      }
      if ((tag & 7) === 4 || tag === 0) {
        break;
      }
      reader.skip(tag & 7);
    }
    return message;
  },

  fromJSON(object: any): PaymentsListData {
    return {
      paymentMethods: globalThis.Array.isArray(object?.paymentMethods)
        ? object.paymentMethods.map((e: any) => PaymentMethod.fromJSON(e))
        : [],
    };
  },

  toJSON(message: PaymentsListData): unknown {
    const obj: any = {};
    if (message.paymentMethods?.length) {
      obj.paymentMethods = message.paymentMethods.map((e) => PaymentMethod.toJSON(e));
    }
    return obj;
  },

  create<I extends Exact<DeepPartial<PaymentsListData>, I>>(base?: I): PaymentsListData {
    return PaymentsListData.fromPartial(base ?? ({} as any));
  },
  fromPartial<I extends Exact<DeepPartial<PaymentsListData>, I>>(object: I): PaymentsListData {
    const message = createBasePaymentsListData();
    message.paymentMethods = object.paymentMethods?.map((e) => PaymentMethod.fromPartial(e)) || [];
    return message;
  },
};

type Builtin = Date | Function | Uint8Array | string | number | boolean | undefined;

export type DeepPartial<T> = T extends Builtin ? T
  : T extends globalThis.Array<infer U> ? globalThis.Array<DeepPartial<U>>
  : T extends ReadonlyArray<infer U> ? ReadonlyArray<DeepPartial<U>>
  : T extends {} ? { [K in keyof T]?: DeepPartial<T[K]> }
  : Partial<T>;

type KeysOfUnion<T> = T extends T ? keyof T : never;
export type Exact<P, I extends P> = P extends Builtin ? P
  : P & { [K in keyof P]: Exact<P[K], I[K]> } & { [K in Exclude<keyof I, KeysOfUnion<P>>]: never };

function isSet(value: any): boolean {
  return value !== null && value !== undefined;
}

export interface MessageFns<T> {
  encode(message: T, writer?: BinaryWriter): BinaryWriter;
  decode(input: BinaryReader | Uint8Array, length?: number): T;
  fromJSON(object: any): T;
  toJSON(message: T): unknown;
  create<I extends Exact<DeepPartial<T>, I>>(base?: I): T;
  fromPartial<I extends Exact<DeepPartial<T>, I>>(object: I): T;
}
